B.Do=new A.ar(7,{id:5,texts:B.AP,is_day:!0,is_night:!1,suggestion:"(Dibaca 1x)",description:"Ya Allah, dengan rahmat dan pertolongan-Mu kami memasuki waktu pagi, dan dengan rahmat dan pertolongan-Mu kami memasuki waktu petang. Dengan rahmat dan pertolongan-Mu kami hidup dan dengan kehendak-Mu kami mati. Dan kepada-Mu kebangkitan (bagi semua makhluk",source:u.B},B.aC,t.M)
